                return <h2>
                    <div>{item.name}</div>
                    <div>{item.age}</div>
                </h2>
            })}

            <table>
                <tr>
                    <th>Company</th>
                    <th>Contact</th>
                    <th>Country</th>
                </tr>
                <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Germany</td>
                </tr>
                </table>

            </>
            )
}
            export default InChild
